import React from 'react';
const Navbar=()=>{
    return (
        <>
            <a href="/" style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>About Us</a>
            &nbsp;&nbsp;&nbsp;
            <a href="/contact" style={{color:'blue',textDecoration:'none',fontSize:'24px'}}>Contact Us</a>
        </>
    );
};
export default Navbar;
